import "./JobForm.css";
import React, { useState } from "react";

const JobForm = ({ onCreate, setJobs }) => {
  const [formData, setFormData] = useState({
    title: "",
    description: "",
    client: "",
    status: "pending",
    whatsappNumber: "",
    email: "",
    file: null,
  });
  const [filePreview, setFilePreview] = useState(null);
  const [successMessage, setSuccessMessage] = useState(false); // Mensagem de sucesso


  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData((prev) => ({ ...prev, [name]: value }));
  };

  const handleFileChange = (e) => {
    const file = e.target.files[0];
    setFormData((prev) => ({ ...prev, file }));
    setFilePreview(file ? URL.createObjectURL(file) : null);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (!formData.whatsappNumber || !formData.email) {
      alert("Por favor, preencha os campos obrigatórios: WhatsApp e Email.");
      return;
    }

    try {
      const body = new FormData();
      Object.entries(formData).forEach(([key, value]) => {
        if (value) body.append(key, value);
      });

      const response = await fetch("http://localhost:8000/api/jobs/create/", {
        method: "POST",
        body,
      });

      if (!response.ok) throw new Error("Erro ao criar o job.");

      const newJob = await response.json();
      setJobs((prev) => [...prev, newJob].sort((a, b) => a.status.localeCompare(b.status)));
      

      // Exibir a mensagem de sucesso e limpar os campos
      setSuccessMessage(true);
      setFormData({
        title: "",
        description: "",
        client: "",
        status: "pending",
        whatsappNumber: "",
        email: "",
        file: null,
      });
      setFilePreview(null); // Limpa a pré-visualização do arquivo

      

    } catch (error) {
      console.error("Erro ao criar o job:", error);
      alert("Erro ao criar o job. Por favor, tente novamente.");
    }
  };
  
console.log("Form data before submit:", formData); // Antes de enviar os dados
console.log("Response from API:", response); // Após obter a resposta
console.log("Data received:", data); // Depois de processar os dados

  return (
    <div>
      {!successMessage ? (
        <form onSubmit={handleSubmit}>
          <input
            type="text"
            name="title"
            value={formData.title}
            onChange={handleInputChange}
            placeholder="Título"
            required
          />
          <textarea
            name="description"
            value={formData.description}
            onChange={handleInputChange}
            placeholder="Descrição"
            required
          />
          <input
            type="text"
            name="client"
            value={formData.client}
            onChange={handleInputChange}
            placeholder="Cliente"
            required
          />
          <select
            name="status"
            value={formData.status}
            onChange={handleInputChange}
          >
            <option value="pending">Pendente</option>
            <option value="approved">Aprovado</option>
            <option value="rejected">Rejeitado</option>
          </select>
          <input
            type="text"
            name="whatsappNumber"
            value={formData.whatsappNumber}
            onChange={handleInputChange}
            placeholder="Número de WhatsApp"
            required
          />
          <input
            type="email"
            name="email"
            value={formData.email}
            onChange={handleInputChange}
            placeholder="Email"
            required
          />
          <input type="file" onChange={handleFileChange} />
          {filePreview && (
            <img src={filePreview} alt="Pré-visualização" style={{ width: 100, height: 100 }} />
          )}
          <button type="submit">Criar Job</button>
        </form>
      ) : (
        <div>
          <h3>Job criado com sucesso!</h3>
          <button onClick={() => setSuccessMessage(false)}>Criar novo job</button>
          <button onClick={onCreate}>Ver lista de jobs</button>
        </div>
      )}
    </div>
  );
};


export default JobForm;
